import React from 'react'
import { Redirect } from 'react-router'
import projects from '../data/ux-data'

export default function WorkPage({match: {params: { id }}}) {

    if ((projects.filter(p => p.id === '/' + p.category+ '/'+id).length <= 0)) {
        return (
            <Redirect to={{pathname: "/404"}}/>
        )
    }
    return (
        <div>
            {id}
        </div>
    )
}
